import React from 'react'
import {getHeaders} from './utils'

class Suggestion extends React.Component {

    constructor(props) {
        super(props);
        // initialization code goes here
        this.state = {
            suggestion: props.model
        }

    }

    componentDidMount() {
        // fetch posts and then set the state
    }

    render() {
        const suggestion = this.state.suggestion;
        return (
            <section 
                className="recommendation-card"
                key={'suggestion_' + suggestion.id}>
                <img class="rounded" src={suggestion.thumb_url}/>
                <div class="recommended-username">
                    <p class="username">{suggestion.username}</p>
                    <p class="suggested-for-you">suggested for you</p>
                </div>
            </section>
        )
    }
}

export default Suggestion;
